import React, { Component, Button} from 'react';
import ExercisesList from "./exercises-list.component";
import { Link } from 'react-router-dom';
import axios from 'axios';

export default class Home extends Component {
  render() {
    return (
      <div>
        <h1>Home</h1>
        <h3>Who are we?</h3>
        <h5>We are a supplement store that sell vitamins and nutrient capsules for people to take.</h5>
        <h5>Are you ready to check out our store? Press the button below to start!</h5>
        <form>
            <Button variant="btn btn-success" onClick={() => ExercisesList.push('/List')}>Click button to view products</Button>
          </form>
      </div>
    )
  }
}
